import React from 'react';

const Title = () => {
  return (
    <div className="title">
      <h1>Ray's Corner</h1>
      <h2>A couple visuals</h2>
      <p><i></i><b>'Perfection is achieved, not when there is nothing more to add, but when there is nothing left to take away'</b><br></br> <i>- Antoine de Saint-Exupery</i></p>
    </div>
  )
}

export default Title;
